Helpers json_query query:String data:Json: Helper able to extract information from json using JMESPath syntax for query. json_str_query query:String data:String: Helper able to extract information from json using JMESPath syntax for query, data follows the requested format. json_to_str data:Json: convert a json data into a string following the requested format. str_to_json data:String: convert(parse) a string into a json following the requested format. The optional requested format, is the format of the string with data: "json" (default if omitted) "json_pretty" json with indentation,... "yaml" "toml" "toml_pretty" usage output {{ json_query "foo" {} }} `` {{ json_to_str ( json_query "foo" {"foo":{"bar":{"baz":true}}} ) }} {"bar":{"baz":true}} {{ json_to_str ( json_query "foo" (str_to_json "{\"foo\":{\"bar\":{\"baz\":true}}}" ) ) }} {"bar":{"baz":true}} {{ json_str_query "foo" "{\"foo\":{\"bar\":{\"baz\":true}}}" }} {"bar":{"baz":true}} {{ json_str_query "foo.bar.baz" "{\"foo\":{\"bar\":{\"baz\":true}}}" }} true {{ json_str_query "foo" "foo:\n bar:\n baz: true\n" format="yaml"}} bar:\n baz: true\n {{ json_to_str ( str_to_json "{\"foo\":{\"bar\":{\"baz\":true}}}" format="json") format="yaml"}} foo:\n bar:\n baz: true\n Blocks {{#from_json format="toml"}}
{"foo": {"hello":"1.2.3", "bar":{"baz":true} } }
{{/from_json}} [foo]
hello = "1.2.3" [foo.bar] baz = true {{#to_json format="toml"}}
[foo]
bar = { baz = true }
hello = "1.2.3"
{{/to_json}} { "foo": { "bar": { "baz": true }, "hello": "1.2.3" }
} {{#from_json format="toml"}}
{"foo":{"bar":{"baz":true}}}
{{/from_json}} foo: bar: baz: true {{#to_json format="yaml"}}
foo: bar: baz: true
{{/to_json}} { "foo": { "bar": { "baz": true } }
} Note: YAML & TOML content are used as input and output format for json data. So capabilities are limited to what json support (eg. no date-time type like in TOML). Edition via jsonnet For more advanced edition of json, you can use jsonnet. A data templating language for app and tool developers See the doc of jsonnet for more samples, syntax info,... This block can be combined with conversion helper/block for YAML & TOML to provide edition capabilities for those format the output should a valid json, except if string_output = false is set as parameter of the block. {{#jsonnet}}
local v = {"foo":{"bar":{"baz":false}}};
v { "foo" +: { "bar" +: { "baz2": true } }
}
{{/jsonnet}} { "foo": { "bar": { "baz": false, "baz2": true } }
